import React from 'react';
import './styles.scss';

function RSVP() {
  return (
    <div className="rsvp-wrapper">
      <div className="no-wrapper half">
        <span className="no">
          <img src="../../assets/no.gif" />

        </span>
      </div>
      <div className="go half">
        <h1>Go</h1>
      </div>
    </div>
  );
}

export default RSVP;
